<script>


////////////VALIDACION///////////////


let restrictRif = false;
let restrictEditRif = true;


let restrictTelefono = false;
let restrictEditTelefono = true;


let restrict = false;
let restrictEdit = true;


function valNombre(){
    if(document.getElementById("nombre").value.length===0){

      $("#nombre").css("border-bottom","2px solid #f27474");

      tippy('#nombre', {
          content: "Introduce un nombre",
          trigger: 'focus',
          animation: 'fade',
        });

      } else {
      $("#nombre").css("border-bottom","2px solid #6acfff");
      }
}

  
function valDireccion(){
    if(document.getElementById("direccion").value.length===0){

      $("#direccion").css("border-bottom","2px solid #f27474");

      tippy('#direccion', {
          content: "Introduce una dirección",
          trigger: 'focus',
          animation: 'fade',
        });

      } else {
      $("#direccion").css("border-bottom","2px solid #6acfff");
      }
}


function valTelefono(){
      let pattern=/^(\+58)?-?([04]\d{3})?-?(\d{3})-?(\d{4})/;
      let campo = document.getElementById('telefono');
     
      let result = pattern.test(campo.value);
      restrictTelefono = result;
      restrictEditTelefono = result;
      if(result === false){
        $("#telefono").css("border-bottom","2px solid #f27474");

        Swal.fire(
                'Introduce un telefono real',
                'Puede empezar por +58 o 04XX.',
                'warning'
            ).then(function(){
                campo.value='';
              });
      }
      else{
        $("#telefono").css("border-bottom","2px solid #6acfff");
      }
  }


  function valRifState(){
    
    let campo = document.getElementById('rif');
    let setRifState = "J"+document.getElementById('rif').value;
    let rifState = document.getElementById('selectRif').value;

    switch (rifState) {
    case "J": setRifState = "J"+document.getElementById('rif').value; break;
    case "V": setRifState = "V"+document.getElementById('rif').value; break;
    case "E": setRifState = "E"+document.getElementById('rif').value; break;
    }
    
      $("#rif").css("border-bottom","2px solid #6acfff");
      $.post("../modelo/modulo_proyecto.php",{
      siCampoExiste: '',
      tabla: 'PROVEEDOR',
      campo: 'RIF',

      dato: setRifState

    },function(data){

      datos= JSON.parse(data);

        if(datos.existe==='1'){
          $("#rif").css("border-bottom","2px solid #f27474");
         
          Swal.fire(
                'Advertencia',
                'Este Rif ya se encuentra registrado',
                'warning'
              ).then(function(){
                campo.value='';
              });

      } 
      else {
      $("#rif").css("border-bottom","2px solid #6acfff");
    }
});
      
}


  function valRif(){
    let setRifState = "J"+document.getElementById('rif').value;
    let rifState = document.getElementById('selectRif').value;

    switch (rifState) {
    case "J": setRifState = "J"+document.getElementById('rif').value; break;
    case "V": setRifState = "V"+document.getElementById('rif').value; break;
    case "E": setRifState = "E"+document.getElementById('rif').value; break;
    }

      let pattern=/^(\d{9})$/;
      let campo = document.getElementById('rif');
     
      let result = pattern.test(campo.value);
      restrictRif = result;
      restrictEditRif = result;
      if(result === false){
        $("#rif").css("border-bottom","2px solid #f27474");

        Swal.fire(
                'Introduce un Rif real',
                'Tiene que contar con 9 digitos.',
                'warning'
            ).then(function(){
                campo.value='';
              });
      }
      else{
      $("#rif").css("border-bottom","2px solid #6acfff");
      $.post("../modelo/modulo_proyecto.php",{
      siCampoExiste: '',
      tabla: 'PROVEEDOR',
      campo: 'RIF',

      dato: setRifState

    },function(data){

      datos= JSON.parse(data);

        if(datos.existe==='1'){
          restrictRif = false;
          $("#rif").css("border-bottom","2px solid #f27474");
         
          Swal.fire(
                'Advertencia',
                'Este Rif ya se encuentra registrado',
                'warning'
              ).then(function(){
                campo.value='';
              });

      } 
      else {
      restrictRif = true;
      $("#rif").css("border-bottom","2px solid #6acfff");
    }
});
      }
  }


function agregarProveedor() {

  
if(restrictRif===true && restrictTelefono===true){
  restrict=true;
}else{
  restrict=false;
}

if (restrict===true && document.getElementById("nombre").value.length>0 && document.getElementById("rif").value.length>0 && document.getElementById("telefono").value.length>0 && document.getElementById("direccion").value.length>0 ){
$.post("proveedores.php",{
agregar: "",
nombre: document.getElementById('nombre').value,
rif: document.getElementById('rif').value,
telefono: document.getElementById('telefono').value,
direccion: document.getElementById('direccion').value

},function(data){

  Swal.fire(
    'Agregada!',
    'El Proveedor ha sido agregado con exito.',
    'success'
  ).then(function(){
    window.location.href="proveedores.php";
 });
});

}else{
  Swal.fire(
    'Introduzca bien los datos',
    'No puedes agregar al Proveedor.',
    'error'
  )
}

}


function editarProveedor() {

if(restrictEditRif===true && restrictEditTelefono===true){
  restrictEdit=true;
}else{
  restrictEdit=false;
}

if (restrictEdit===true && document.getElementById("nombre").value.length>0 && document.getElementById("rif").value.length>0 && document.getElementById("telefono").value.length>0 && document.getElementById("direccion").value.length>0 ){
$.post("proveedores.php",{
guardar: "",
nombre: document.getElementById('nombre').value,
rif: document.getElementById('rif').value,
telefono: document.getElementById('telefono').value,
direccion: document.getElementById('direccion').value

},function(data){

  Swal.fire(
    'Agregada!',
    'El Proveedor ha sido agregado con exito.',
    'success'
  ).then(function(){
    window.location.href="proveedores.php";
 });
});

}else{
  Swal.fire(
    'Introduzca bien los datos',
    'No puedes agregar al Proveedor.',
    'error'
  )
}

}

function borrar(rif) {

  Swal.fire({
  title: 'Estas seguro que desea Eliminar',
  text: "Seguro que quieres eliminar este Proveedor",
  icon: 'warning',
  showCancelButton: true,
  confirmButtonColor: '#3085d6',
  cancelButtonColor: '#d33',
  cancelButtonText: "Cancelar",
  confirmButtonText: 'Si!'
  }).then((result) => {
    if (result.isConfirmed) {
      Swal.fire(
        'Borrada!',
        'El Proveedor ha sido borrado.',
        'success'
      ).then(function(){ 
        window.location.href="proveedores.php?user=&borrar=0&id="+ rif; }
      );
     }
    }
  )
}

</script>
